import React from "react";
import './MoviesList.css';
import MovieCard from '../../../cards/moviecard/MovieCard'

function MoviesList() {
    return ( 
        <React.Fragment>

            <h3>Movies list:</h3>

            <div className="movieslist-container">
             <MovieCard movie={':)'}/>
             <MovieCard movie={':)'}/>
             <MovieCard movie={':)'}/>
             <MovieCard movie={':)'}/>
             <MovieCard movie={':)'}/>
             
            </div>

        </React.Fragment>
     );
}

export default MoviesList;
